import style from "./FilterBy.module.css"; 
import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getTemperaments } from "../../redux/actions";

const FilterBy = () => {
  const dispatch = useDispatch();
  const temperaments = useSelector((state) => state.temperaments);
  const [showTemperaments, setShowTemperaments] = useState(false);

  useEffect(() => {
    dispatch(getTemperaments());
  }, [dispatch]);

  return (
    <div>
        <div>
      <button onClick={() => setShowTemperaments(!showTemperaments)}>Show Temperaments</button>
      {showTemperaments && (
        <div >

          <ol>
            {temperaments.map((temperament) => (
              <li key={temperament.id}>{temperament.name}</li>
            ))}
          </ol>
        </div>
      )}
    </div>
    </div>
  );
};

export default FilterBy;
